import React, { useState, useEffect, useRef } from "react";
import { connect } from "react-redux";
import { fetchApi } from "../../api";

import "./style.scss";
import molniya from "../../img/icon/smallmolniya.svg";

const s2p = ({ map }) => ({
  map: map
});
const d2p = dispatch => ({
  fetchApi: val => {
    dispatch(fetchApi(val));
  }
});

const CountryPath = ({
  country,
  active,
  click,
  mostIssuesIds,
  countryPosition
}) => {
  const id = +country.props.id;
  const isActive = id === active;
  const isLake = /region_/.test(country.props.id);
  const popularClass = mostIssuesIds.includes(id) ? "popular" : "";
  const regionClasses =
    country.props.className +
    " " +
    (isActive && !isLake ? "active" : "") +
    " " +
    popularClass;

  let position = null;
  const pos = el => {
    if (el) {
      position = el.getBoundingClientRect();
    }
  };
  useEffect(() => {
    if (isActive) {
      countryPosition(position);
    }
  }, [active]);

  const onClick = id => () => {
    if (isLake) {
      return;
    }
    countryPosition(position);
    click(id);
  };

  return (
    <g ref={pos} key={country.region_num}>
      {React.cloneElement(country, {
        className: regionClasses,
        onClick: onClick(id)
      })}
    </g>
  );
};

const Countries = props => {
  return (
    <g>
      {props.children.map(child => (
        <CountryPath key={child.props.id} country={child} {...props}/>
      ))}
    </g>
  );
};

